import React from 'react';
import {
  SafeAreaView,
  ScrollView,
  StatusBar,
  StyleSheet,
  Text,
  Button,
  useColorScheme,
  View,
} from 'react-native';

const StartPage = (props) => {

  const setScreen = () => {props.setScreen(1)}

  return (
  <View style={[{alignItems: 'center'},{top: 50}]}>
    <Text>Mi Cocina</Text>
    <Button title='Start' color="#90EE90" onPress={setScreen}>Begin</Button>
  </View>
  );
};

export default StartPage;
